import NavBar from "../components/NavBar"
import TemperatureContainer from "../components/TemperatureContainer"
import {
    Box,
    Button
} from "@chakra-ui/react"

export function OOTD(props: any) {
    return (
        <>
            <NavBar />
            <TemperatureContainer />
            <Box 
                position='fixed'
                bottom='0px'
                right={['16px', '40px']}
                zIndex={0}
            >
                <Button>
                    Generate
                </Button>
            </Box>
        </>
    )
}
